#define BCMPKT_TRACE_COUNTER_BLOCK_MASK_DROP     11
/*! DOS fragment error packets. */
#define BCMPKT_TRACE_COUNTER_DSFRAG              12
/*! DOS ICMP error packets. */
#define BCMPKT_TRACE_COUNTER_DSICMP              13
/*! Dos Attack L2 Packets. */
#define BCMPKT_TRACE_COUNTER_DSL2HE              14
/*! Bridged Multicast pkts. */
#define BCMPKT_TRACE_COUNTER_IMBP                15
/*! LAG failover loopback pkt. */
#define BCMPKT_TRACE_COUNTER_LAGLUP              16
/*! LAG failover loopback pkt discarded. */
#define BCMPKT_TRACE_COUNTER_LAGLUPD             17
/*! Pkts dropped due to MTU check fail. */
#define BCMPKT_TRACE_COUNTER_MTU_CHECK_FAIL      18
/*! Pkts dropped due to parity error. */
#define BCMPKT_TRACE_COUNTER_PARITYD             19
/*! Non-IP packet discard dropped. */
#define BCMPKT_TRACE_COUNTER_PDISC               20
/*! Portbitmap zero drop condition. */
#define BCMPKT_TRACE_COUNTER_RDROP               21
/*! Multicast (L2+L3) packets that are dropped. */
#define BCMPKT_TRACE_COUNTER_RIMDR               22
/*! Pkts dropped as ingress port's SP state is not forwarding. */
#define BCMPKT_TRACE_COUNTER_RPORTD              23
/*! Good Tunnel terminated packets. */
#define BCMPKT_TRACE_COUNTER_RTUN                24
/*! Receive tunnel error packets. */
#define BCMPKT_TRACE_COUNTER_RTUNE               25
/*! Good Unicast Packets. */
#define BCMPKT_TRACE_COUNTER_RUC                 26
/*! Drop due to source port knockout. */
#define BCMPKT_TRACE_COUNTER_SRC_PORT_KNOCKOUT_DROP 27
/*! IBP discard and CBP full. */
#define BCMPKT_TRACE_COUNTER_RDISC               28
/*! Packets dropped by FP. */
#define BCMPKT_TRACE_COUNTER_RFILDR              29
/*! HiGig IPIC pause receive counter. */
#define BCMPKT_TRACE_COUNTER_IRPSE               30
/*! HiGig End-to-End HOL receive packet counter. */
#define BCMPKT_TRACE_COUNTER_IRHOL               31
/*! HiGig End-to-End IBP receive packet counter. */
#define BCMPKT_TRACE_COUNTER_IRIBP               32
/*! DOS L3 header error packets (only applicable to packet from 10GE port). */
#define BCMPKT_TRACE_COUNTER_DSL3HE              33
/*! Unknown HiGig header type packet (only applicable to packet from HiGig port). */
#define BCMPKT_TRACE_COUNTER_IUNKHDR             34
/*! DOS L4 header error packets (only applicable to packet from 10GE port). */
#define BCMPKT_TRACE_COUNTER_DSL4HE              35
/*! HiGig mirror packet (only applicable to packet from HiGig port). */
#define BCMPKT_TRACE_COUNTER_IMIRROR             36
/*! Packets trapped to CPU due to egress L3 MTU violation. */
#define BCMPKT_TRACE_COUNTER_MTUERR              37
/*! Receive VLAN drop cases. */
#define BCMPKT_TRACE_COUNTER_VLANDR              38
/*! HiGig Header error packets. */
#define BCMPKT_TRACE_COUNTER_HGHDRE              39
/*! Multicast Index error packets. */
#define BCMPKT_TRACE_COUNTER_MCIDXE              40
/*! Receive HiGig Unicast packet. */
#define BCMPKT_TRACE_COUNTER_RHGUC               41
/*! Receive HiGig non-Unicast packet. */
#define BCMPKT_TRACE_COUNTER_RHGMC               42
/*! Unicast Reverse Path Forwarding. */
#define BCMPKT_TRACE_COUNTER_URPF                43
/*! VLAN FP drop case. */
#define BCMPKT_TRACE_COUNTER_VFPDR               44
/*! L2/L3 lookup DST_DISCARD drop. */
#define BCMPKT_TRACE_COUNTER_DSTDISC             45
/*! Class based learning drop. */
#define BCMPKT_TRACE_COUNTER_CBLDROP             46
/*! MAC limit exceeded and packet not dropped. */
#define BCMPKT_TRACE_COUNTER_MACLMT_NODROP       47
/*! MAC limit exceeded and packet dropped. */
#define BCMPKT_TRACE_COUNTER_MACLMT_DROP         48
/*! VNTAG Error packet dropped. */
#define BCMPKT_TRACE_COUNTER_VNTAG_ERROR         49
/*! NIV Forwarding Error dropped. */
#define BCMPKT_TRACE_COUNTER_NIV_FORWARDING_DROP 50
/*! Non-Trill Frame on Network Port dropped. */
#define BCMPKT_TRACE_COUNTER_OFFSET_NONTRILL_FRAME_ON_NW_PORT_DROP 51
/*! Trill Frame on Access Port dropped. */
#define BCMPKT_TRACE_COUNTER_OFFSET_TRILL_FRAME_ON_ACCESS_PORT_DROP 52
/*! Trill errors dropped. */
#define BCMPKT_TRACE_COUNTER_OFFSET_TRILL_ERRORS_DROP 53
/*! Trill RBridge Lookup Miss dropped. */
#define BCMPKT_TRACE_COUNTER_OFFSET_TRILL_RBRIDGE_LOOKUP_MISS_DROP 54
/*! Trill HopCount check fail dropped. */
#define BCMPKT_TRACE_COUNTER_OFFSET_TRILL_HOPCOUNT_CHECK_FAIL 55
/*! Trill RPF Check Fail dropped. */
#define BCMPKT_TRACE_COUNTER_OFFSET_TRILL_RPF_CHECK_FAIL_DROP 56
/*! Virtual-Output-Queue-based Flow-Control-Message receive packet counter. */
#define BCMPKT_TRACE_COUNTER_IRVOQFC             57
/*! ECMP not resolved. */
#define BCMPKT_TRACE_COUNTER_ECMP_NOT_RESOLVED   58
/*! BCMPKT_TRACE_COUNTER TYPE NUMBER */
#define BCMPKT_TRACE_COUNTER_COUNT               59
